  \"Distribution, abundance and productivity of fall staging lesser snow geese on
  coastal habitats of northeast Alaska and northwest Canada, 1982\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 2,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T23:02:00.847289\",\n\t\"name\": \"distribution-abundance-and-productivity-of-fall-staging-lesser-snow-geese-on-coastal-habit\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Fall staging of the western arctic lesser
  snow goose population was I. monitored on the coastal plain of the Arctic National
  Wildlife Refuge (ANWR), Yukon Territory and the Mackenzie River delta from 7 August
  to 22 September I 1982. The onset of staging in 1982 was earlier than usual, but
  major arrivals were normal, occurring 24-26 August. The duration of the staging
  period (20 days) was the second longest observed since 1971. A gradual buildup in
  numbers occurred through late August and early September with 30-40,000 birds estimated
  using the ANWR coastal plain at that time. Peak snow goose numbers were estimated
  on 14-15 September at 107, 1072 + 13,866 in Alaska; 117,892 + 15,279 in Yukon, and
  6155 in the Mackenzie delta, for a total western arctic population estimate of 231,119
  + 29,242. Estimated productivity was low, at 4.6% young. Spatial variation in productivity
  was observed, with concentrations of higher productivity occurring in Alaska as
  compared to farther east, a pattern opposite to that observed in 1981.\",\n\t\"license_title\":
